create table user
(
    id            int auto_increment
        primary key,
    username      varchar(200)         null,
    password      varchar(200)         null,
    schoolname    varchar(200)         null,
    contact       varchar(200)         null comment '联系人',
    address       varchar(200)         null comment '学校详细地址
',
    telephone     varchar(200)         null comment '学校官方电话
',
    update_time   datetime             null,
    schoolCode    varchar(100)         null comment '学校代码
',
    location      varchar(200)         null comment '用户上次登录的地址',
    add_time      datetime             null,
    lastLoginIp   varchar(200)         null comment '上次登录ip',
    lastLoginTime datetime             null comment '上次登录时间',
    deleted       tinyint(1) default 0 null,
    avatarUrl     varchar(200)         null,
    accountStatus int                  null comment '账户状态',
    profession    varchar(60)          null comment '职务',
    country       varchar(255)         null comment '学校所在国家'
);

